import { makeStyles } from '@material-ui/styles';

const classe = makeStyles({
  paper: {
    marginTop: '10%',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },

  imagem: {
    background: '#338DFF',
    margin: '2%',
    marginTop: '3%',
    marginBottom: '1%',
  },

  form: {
    width: '100%',
    marginTop: '10%',
  },

  adorno: {
    marginLeft: '1%',
    width: 30,
  },

  botao: {
    margin: '10%',
  },
  input: {
    marginTop: '10%',
  },
});

export default classe;
